import React from 'react'

const Contact = () => {
    return (
        <div name='contact' className='w-full h-screen bg-[#0a192f] flex items-center p-4'>

            <form action="" className='flex flex-col max-w-[600px] w-full'>
                <div pb-8>
                    <p className='text-4xl font-bold inline border-b-4 border-[#a32638]'>Contact</p>
                </div>
            </form>
        </div>
    )
}

export default Contact
